import React, { useState } from "react";
import "./big_form.css";

function EmployeeForm() {
  const [formData, setFormData] = useState({
    NAME: "",
    BDATE: "",
    SEX: "",
    MTONGUE: "",
    RELEGION: "",
    CAST: "",
    P_ADDRESS: "",
    P_PHONE: "",
    P_CODE: "",
    DISTANCE: "",
    S_PHONE: "",
    S_CODE: "",
    MAIL: "",
    F_NAME: "",
    M_NAME: "",
    G_NAME: "",
    EDUCATIONAL_QUALIFICATION: "",
    OCCU: "",
    M_INCOME: "",
    C_INFO: "",
    C_AILMENT: "",
    C_AILMENT_INFO: "",
    APPLICATION_ID: "",
  });

  const [file, setFile] = useState(null);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value,
    });
  };

  const handleFileChange = (e) => {
    const file = e.target.files[0];
    setFile(file);
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    // Create a FormData object
    const formDataWithFile = new FormData();

    // Append form data to FormData
    for (const key in formData) {
      formDataWithFile.append(key, formData[key]);
    }

    // Append file to FormData
    formDataWithFile.append("image", file);

    // Convert image to base64
    const reader = new FileReader();
    reader.onload = () => {
      formDataWithFile.append("imageBase64", reader.result);

      // Send FormData to backend
      fetch("http://49.206.252.212:5000/STUDENT_MASTER", {
        method: "POST",
        body: formDataWithFile,
      })
        .then((response) => {
          if (!response.ok) {
            throw new Error("Network response was not ok");
          }
          return response.json();
        })
        .then((data) => {
          console.log("Success:", data);
          if (data.success) {
            alert("Data entered successfully");
          } else {
            alert("Failed to enter data");
          }
        })
        .catch((error) => {
          console.error("Error:", error);
          // Optionally, you can handle errors here
        });
    };

    // Read the image file as data URL
    reader.readAsDataURL(file);
  };


  return (
    <div className="form-container">
      <h2 className="form-header">Employee master</h2>
      <form className="form" onSubmit={handleSubmit}>
        <label className="form-label">
          NAME:
          <input
            type="text"
            name="NAME"
            value={formData.NAME}
            onChange={handleChange}
            className="form-input"
          />
        </label>
        <br />
        <label className="form-label">
          BDATE:
          <input
            type="date"
            name="BDATE"
            value={formData.BDATE}
            onChange={handleChange}
            className="form-input"
          />
        </label>
        <br />
        <label className="form-label">
          SEX:
          <input
            type="text"
            name="SEX"
            value={formData.SEX}
            onChange={handleChange}
            className="form-input"
          />
        </label>
        <br />
        <label className="form-label">
          Mtongue:
          <input
            type="text"
            name="MTONGUE"
            value={formData.MTONGUE}
            onChange={handleChange}
            className="form-input"
          />
        </label>
        <br />
        <label className="form-label">
          Relegion:
          <input
            type="text"
            name="RELEGION"
            value={formData.RELEGION}
            onChange={handleChange}
            className="form-input"
          />
        </label>
        <br />
        <label className="form-label">
          cast:
          <input
            type="text"
            name="CAST"
            value={formData.CAST}
            onChange={handleChange}
            className="form-input"
          />
        </label>
